import React from 'react';

const QuizList = ({ quizzes }) => {
  return (
    <div className="quiz-list">
      {quizzes.map(quiz => (
        <div key={quiz.id} className="quiz-item">
          <h3>{quiz.title}</h3>
          {/* Other quiz details */}
        </div>
      ))}
    </div>
  );
};

export default QuizList;
